import React from 'react'
import Card from './Card'

function Cart(props) {
  return (
    <div className='cart'>
      <h2>Cart</h2>
      {props.cartItems.map((item, index) => 
        
        <Card key={index} item={item} />
      )}
    </div>
  )
}

export default Cart
